import React, { Component } from 'react';
import './home.css';
import { Parallax } from 'react-parallax';


const image1 = "https://images.unsplash.com/photo-1503252947848-7338d3f92f31?ixlib=rb-1.2.1&q=80&fm=jpg&crop=entropy&cs=tinysrgb&w=2000&fit=max&ixid=eyJhcHBfaWQiOjExNzczfQ";

const inlineStyle = {
background: '#fff',
left: '50%',
top: '50%',
position: 'absolute'

}

class Home extends Component {

    render(){
        return(
            <Parallax bgImage={ image1 }>
                <div className="banner">
                <div style={inlineStyle}>HTM INSIDE Parallax</div>

                </div>
            </Parallax>
        )
    }

}


export default Home;
